import axios from "axios"
export const removeFromCart=async(productId,encodedToken)=>{
try{
const response=await axios.post(`/api/user/cart/${productId}`,
{headers:{authorization:encodedToken}}
);
console.log(response);
}
catch(e){
    console.log(e)
}
}
